import React from 'react';
import Booking from 'components/Booking/Booking';
import HotelRoom from 'images/heroimgdesktop.jpg'
import styled from 'styled-components'
import { InnerWrapper, OuterWrapper } from 'styles/MainStyles';

const Book = () => {

    return (
    <>
    <OuterWrapper>
    <InnerWrapper>
    <StartSection>
    <ImageBooking src={HotelRoom} alt="Hotel Room" />
    </StartSection>
    <Booking/>
    </InnerWrapper>
    </OuterWrapper>
    </>
    )
}

export default Book;

export const StartSection = styled.section`
border: 2px solid lime;
position: relative;
width: 90%;
`

export const ImageBooking = styled.img`
border: 2px solid lime;
position: relative;
width: 100%;
`
